  true,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry and gravity data
  along with DGPS navigation data was collected as part of field activity L-7-80-BS
  in Bering Sea, Alaska from 08/01/1980 to 08/26/1980, http://walrus.wr.usgs.gov/infobank/l/l780bs/html/l-7-80-bs.meta.html
  These data are reformatted from space-delimited ASCII text files located in the
  Coastal and Marine Geology Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/l/l780bs/html/l-7-80-bs.bath.html
  and http://walrus.wr.usgs.gov/infobank/l/l780bs/html/l-7-80-bs.grav.html into MGD77T
  format provided by the NOAA's National Geophysical Data Center(NGDC). The MGD77T
  format includes a header (documentation) file (.h77t) and a data file (.m77t). More
  information regarding this format can be found in the publication listed in the
  Cross_reference section of this metadata file.\",\n\t\"license_title\": \"Creative
